p.x:
var $bm_rt;
var x, y;
x = $bm_div(thisComp.width, 2);
y = $bm_div(thisComp.height, 2);
$bm_rt = [
    x,
    y
];

s.x:
var $bm_rt;
var ow = 1920;
var oh = 1080;
var w = thisComp.width;
var h = thisComp.height;
var wf = $bm_div(w, 16);
var hf = $bm_div(h, 9);
var adjustTo, factor, newScale;
if (hf < wf) {
    adjustTo = h;
    factor = oh;
} else {
    adjustTo = w;
    factor = ow;
}
;
newScale = $bm_div($bm_mul(adjustTo, 100), factor);
$bm_rt = [
    newScale,
    newScale,
    newScale
];

