var $bm_rt;
var T, sIn, sOut;
$bm_rt = T = thisLayer;
if (numKeys >= 2) {
    sIn = $bm_sub(key(2).time, key(1).time);
    sOut = key(2).time;
    $bm_rt = linear(time, T.inPoint, T.outPoint, key(1).value, key(2).value);
} else {
    $bm_rt = value;
}
